import React from 'react';
import Child from "./Child";

const Parents = () => {
    const children = [
        { id: 1, name: "1", properties: "Child1" },
        { id: 2, name: "2", properties: "Child2" },
        { id: 3, name: "3", properties: "Child3" },
        { id: 4, name: "4", properties: "Child4" },
        { id: 5, name: "5", properties: "Child5" },
    ];

    return (
        <>
            {children.map((child) => (
                <Child 
                    key={child.id} 
                    name={child.name} 
                    properties={child.properties} 
                    parentName="Parent Component" 
                />
            ))}
        </>
    );
};

export default Parents;
